<script setup lang="ts">
// There's a class here
// BEWARE when replacing
import { ref } from 'vue';

function throttle(func, delay) {
  let lastCall = 0;
  return function (...args) {
    const now = Date.now();
    if (now - lastCall >= delay) {
      lastCall = now;
      func(...args);
    }
  };
}

function getRandomOffset(min, max) {
  return Math.random() * (max - min) + min;
}

const props = defineProps(['isDone'])

const flowers = ref([]);

function createFlower(x, y) {
  const flowerCircles = [
    { cx: x, cy: y, r: 4.2716, fill: '#F5FF66' },
    { cx: x + getRandomOffset(5, 10), cy: y + getRandomOffset(3, 8), r: 4.2716, fill: 'white' },
    { cx: x - getRandomOffset(5, 10), cy: y - getRandomOffset(2, 6), r: 4.2716, fill: 'white' },
    { cx: x + getRandomOffset(-6, 6), cy: y - getRandomOffset(4, 8), r: 4.2716, fill: 'white' },
    { cx: x + getRandomOffset(-8, 8), cy: y + getRandomOffset(-8, 8), r: 3.5, fill: '#FFAAFF' }
  ];

  flowers.value.push(flowerCircles);

  if (flowers.value.length > 30) {
    flowers.value.shift();
  }
}

const handleMouseOver = throttle((e) => {
  if (!props.isDone) {return;}
  const svg = e.target.closest('svg');
  if (!svg) return;

  const point = svg.createSVGPoint();
  point.x = e.clientX;
  point.y = e.clientY;

  const svgPoint = point.matrixTransform(svg.getScreenCTM().inverse());

  const pathElement = svg.querySelector('path');
  if (pathElement && pathElement.isPointInFill(svgPoint)) {
    createFlower(svgPoint.x, svgPoint.y);
  }
}, 50);

</script>
